//stories: img / usuario 

function Story(props) {
    console.log(props)

    return (
        <div class="story">
            <div class="imagem">
                <img src={props.urlImage}/>
            </div>
            <div class="usuario">
                {props.user}
            </div>
        </div>
        )

}


export default function Stories() {

    return (
        <div class="stories">
            <Story urlImage="assets/img/9gag.svg" user="9gag" />
            <Story urlImage="assets/img/barked.svg" user="barked" />
            <Story urlImage="assets/img/nathanwpylestrangeplanet.svg" user="nathanwpylestrangeplanet" />
            <Story urlImage="assets/img/wawawicomics.svg" user="wawawicomics" />
            <Story urlImage="assets/img/respondeai.svg" user="respondeai" />
            <Story urlImage="assets/img/filomoderna.svg" user="filomoderna" />
            <Story urlImage="assets/img/9gag.svg" user="9gag" />
            <div class="setinha">
                <ion-icon name="chevron-forward-circle"></ion-icon>
            </div>
        </div>

    )
}
